@testset "7.3.3 (d+e x)^m (a+b arctanh(c x^n))^p" begin
    (a, b, c, d, e, x, ) = @variables a b c d e x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*(d+e*x)^m*(a+b*atanh(c*x^n))^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(d+e*x)^m*(a+b*atanh(c*x^1))^p=#


    @test_int [(d + e*x)^4*(a + b*atanh(c*x)), x, 6, (b*d*e*(2*c^2*d^2 + e^2)*x)/c^3 + (b*e^2*(10*c^2*d^2 + e^2)*x^2)/(10*c^3) + (b*d*e^3*x^3)/(3*c) + (b*e^4*x^4)/(20*c) + ((d + e*x)^5*(a + b*atanh(c*x)))/(5*e) + (b*(c*d + e)^5*log(1 - c*x))/(10*c^5*e) - (b*(c*d - e)^5*log(1 + c*x))/(10*c^5*e)]
    @test_int [(d + e*x)^3*(a + b*atanh(c*x)), x, 6, (b*e*(6*c^2*d^2 + e^2)*x)/(4*c^3) + (b*d*e^2*x^2)/(2*c) + (b*e^3*x^3)/(12*c) + ((d + e*x)^4*(a + b*atanh(c*x)))/(4*e) + (b*(c*d + e)^4*log(1 - c*x))/(8*c^4*e) - (b*(c*d - e)^4*log(1 + c*x))/(8*c^4*e)]
    @test_int [(d + e*x)^2*(a + b*atanh(c*x)), x, 6, (b*d*e*x)/c + (b*e^2*x^2)/(6*c) + ((d + e*x)^3*(a + b*atanh(c*x)))/(3*e) + (b*(c*d + e)^3*log(1 - c*x))/(6*c^3*e) - (b*(c*d - e)^3*log(1 + c*x))/(6*c^3*e)]
    @test_int [(d + e*x)^1*(a + b*atanh(c*x)), x, 6, (b*e*x)/(2*c) + ((d + e*x)^2*(a + b*atanh(c*x)))/(2*e) + (b*(c*d + e)^2*log(1 - c*x))/(4*c^2*e) - (b*(c*d - e)^2*log(1 + c*x))/(4*c^2*e)]
    @test_int [(a + b*atanh(c*x))/(d + e*x)^1, x, 4, -(((a + b*atanh(c*x))*log(2/(1 + c*x)))/e) + ((a + b*atanh(c*x))*log((2*c*(d + e*x))/((c*d + e)*(1 + c*x))))/e + (b*PolyLog(2, 1 - 2/(1 + c*x)))/(2*e) - (b*PolyLog(2, 1 - (2*c*(d + e*x))/((c*d + e)*(1 + c*x))))/(2*e)]
    @test_int [(a + b*atanh(c*x))/(d + e*x)^2, x, 6, -((a + b*atanh(c*x))/(e*(d + e*x))) - (b*c*log(1 - c*x))/(2*e*(c*d + e)) + (b*c*log(1 + c*x))/(2*(c*d - e)*e) - (b*c*log(d + e*x))/(c^2*d^2 - e^2)]
    @test_int [(a + b*atanh(c*x))/(d + e*x)^3, x, 4, (b*c)/(2*(c^2*d^2 - e^2)*(d + e*x)) - (a + b*atanh(c*x))/(2*e*(d + e*x)^2) - (b*c^2*log(1 - c*x))/(4*e*(c*d + e)^2) + (b*c^2*log(1 + c*x))/(4*(c*d - e)^2*e) - (b*c^3*d*log(d + e*x))/(c^2*d^2 - e^2)^2]
    @test_int [(a + b*atanh(c*x))/(d + e*x)^4, x, 4, If(13>=8, (b*c)/(6*(c^2*d^2 - e^2)*(d + e*x)^2) + (2*b*c^3*d)/(3*(c^2*d^2 - e^2)^2*(d + e*x)) - (a + b*atanh(c*x))/(3*e*(d + e*x)^3) - (b*c^3*log(1 - c*x))/(6*e*(c*d + e)^3) + (b*c^3*log(1 + c*x))/(6*(c*d - e)^3*e) - (b*c^3*(3*c^2*d^2 + e^2)*log(d + e*x))/(3*(c*d - e)^3*(c*d + e)^3), (b*c)/(6*(c^2*d^2 - e^2)*(d + e*x)^2) + (2*b*c^3*d)/(3*(c^2*d^2 - e^2)^2*(d + e*x)) - (a + b*atanh(c*x))/(3*e*(d + e*x)^3) - (b*c^3*log(1 - c*x))/(6*e*(c*d + e)^3) + (b*c^3*log(1 + c*x))/(6*(c*d - e)^3*e) - (b*c^3*(3*c^2*d^2 + e^2)*log(d + e*x))/(3*(c^2*d^2 - e^2)^3))]


    @test_int [(d + e*x)^3*(a + b*atanh(c*x))^2, x, 19, (b^2*d*e^2*x)/c^2 + (a*b*e*(6*c^2*d^2 + e^2)*x)/(2*c^3) + (b^2*e^3*x^2)/(12*c^2) - (b^2*d*e^2*atanh(c*x))/c^3 + (b^2*e*(6*c^2*d^2 + e^2)*x*atanh(c*x))/(2*c^3) + (b*d*e^2*x^2*(a + b*atanh(c*x)))/c + (b*e^3*x^3*(a + b*atanh(c*x)))/(6*c) + (d*(c^2*d^2 + e^2)*(a + b*atanh(c*x))^2)/c^3 - ((c^4*d^4 + 6*c^2*d^2*e^2 + e^4)*(a + b*atanh(c*x))^2)/(4*c^4*e) + ((d + e*x)^4*(a + b*atanh(c*x))^2)/(4*e) - (2*b*d*(c^2*d^2 + e^2)*(a + b*atanh(c*x))*log(2/(1 - c*x)))/c^3 + (b^2*e^3*log(1 - c^2*x^2))/(12*c^4) + (b^2*e*(6*c^2*d^2 + e^2)*log(1 - c^2*x^2))/(4*c^4) - (b^2*d*(c^2*d^2 + e^2)*PolyLog(2, 1 - 2/(1 - c*x)))/c^3]
    @test_int [(d + e*x)^2*(a + b*atanh(c*x))^2, x, 15, (2*a*b*d*e*x)/c + (b^2*e^2*x)/(3*c^2) - (b^2*e^2*atanh(c*x))/(3*c^3) + (2*b^2*d*e*x*atanh(c*x))/c + (b*e^2*x^2*(a + b*atanh(c*x)))/(3*c) + ((3*c^2*d^2 + e^2)*(a + b*atanh(c*x))^2)/(3*c^3) - (d*(d^2 + (3*e^2)/c^2)*(a + b*atanh(c*x))^2)/(3*e) + ((d + e*x)^3*(a + b*atanh(c*x))^2)/(3*e) - (2*b*(3*c^2*d^2 + e^2)*(a + b*atanh(c*x))*log(2/(1 - c*x)))/(3*c^3) + (b^2*d*e*log(1 - c^2*x^2))/c^2 - (b^2*(3*c^2*d^2 + e^2)*PolyLog(2, 1 - 2/(1 - c*x)))/(3*c^3)]
    @test_int [(d + e*x)^1*(a + b*atanh(c*x))^2, x, 12, (a*b*e*x)/c + (b^2*e*x*atanh(c*x))/c + (d*(a + b*atanh(c*x))^2)/c - ((d^2 + e^2/c^2)*(a + b*atanh(c*x))^2)/(2*e) + ((d + e*x)^2*(a + b*atanh(c*x))^2)/(2*e) - (2*b*d*(a + b*atanh(c*x))*log(2/(1 - c*x)))/c + (b^2*e*log(1 - c^2*x^2))/(2*c^2) - (b^2*d*PolyLog(2, 1 - 2/(1 - c*x)))/c]
    @test_int [(a + b*atanh(c*x))^2/(d + e*x)^1, x, 1, -(((a + b*atanh(c*x))^2*log(2/(1 + c*x)))/e) + ((a + b*atanh(c*x))^2*log((2*c*(d + e*x))/((c*d + e)*(1 + c*x))))/e + (b*(a + b*atanh(c*x))*PolyLog(2, 1 - 2/(1 + c*x)))/e - (b*(a + b*atanh(c*x))*PolyLog(2, 1 - (2*c*(d + e*x))/((c*d + e)*(1 + c*x))))/e + (b^2*PolyLog(3, 1 - 2/(1 + c*x)))/(2*e) - (b^2*PolyLog(3, 1 - (2*c*(d + e*x))/((c*d + e)*(1 + c*x))))/(2*e)]
    @test_int [(a + b*atanh(c*x))^2/(d + e*x)^2, x, 12, -((a + b*atanh(c*x))^2/(e*(d + e*x))) + (b*c*(a + b*atanh(c*x))*log(2/(1 - c*x)))/(e*(c*d + e)) - (b*c*(a + b*atanh(c*x))*log(2/(1 + c*x)))/((c*d - e)*e) + (2*b*c*(a + b*atanh(c*x))*log(2/(1 + c*x)))/(c^2*d^2 - e^2) - (2*b*c*(a + b*atanh(c*x))*log((2*c*(d + e*x))/((c*d + e)*(1 + c*x))))/(c^2*d^2 - e^2) + (b^2*c*PolyLog(2, 1 - 2/(1 - c*x)))/(2*e*(c*d + e)) + (b^2*c*PolyLog(2, 1 - 2/(1 + c*x)))/(2*(c*d - e)*e) - (b^2*c*PolyLog(2, 1 - 2/(1 + c*x)))/(c^2*d^2 - e^2) + (b^2*c*PolyLog(2, 1 - (2*c*(d + e*x))/((c*d + e)*(1 + c*x))))/(c^2*d^2 - e^2)]
    @test_int [(a + b*atanh(c*x))^2/(d + e*x)^3, x, 18, If(13>=8, (b*c*(a + b*atanh(c*x)))/((c^2*d^2 - e^2)*(d + e*x)) - (a + b*atanh(c*x))^2/(2*e*(d + e*x)^2) + (b*c^2*(a + b*atanh(c*x))*log(2/(1 - c*x)))/(2*e*(c*d + e)^2) + (b^2*c^2*log(1 - c*x))/(2*(c*d - e)*(c*d + e)^2) - (b*c^2*(a + b*atanh(c*x))*log(2/(1 + c*x)))/(2*(c*d - e)^2*e) + (2*b*c^3*d*(a + b*atanh(c*x))*log(2/(1 + c*x)))/((c*d - e)^2*(c*d + e)^2) - (b^2*c^2*log(1 + c*x))/(2*(c*d - e)^2*(c*d + e)) + (b^2*c^2*e*log(d + e*x))/((c*d - e)^2*(c*d + e)^2) - (2*b*c^3*d*(a + b*atanh(c*x))*log((2*c*(d + e*x))/((c*d + e)*(1 + c*x))))/((c*d - e)^2*(c*d + e)^2) + (b^2*c^2*PolyLog(2, 1 - 2/(1 - c*x)))/(4*e*(c*d + e)^2) + (b^2*c^2*PolyLog(2, 1 - 2/(1 + c*x)))/(4*(c*d - e)^2*e) - (b^2*c^3*d*PolyLog(2, 1 - 2/(1 + c*x)))/((c*d - e)^2*(c*d + e)^2) + (b^2*c^3*d*PolyLog(2, 1 - (2*c*(d + e*x))/((c*d + e)*(1 + c*x))))/((c*d - e)^2*(c*d + e)^2), (b*c*(a + b*atanh(c*x)))/((c^2*d^2 - e^2)*(d + e*x)) - (a + b*atanh(c*x))^2/(2*e*(d + e*x)^2) + (b*c^2*(a + b*atanh(c*x))*log(2/(1 - c*x)))/(2*e*(c*d + e)^2) + (b^2*c^2*log(1 - c*x))/(2*(c*d - e)*(c*d + e)^2) - (b*c^2*(a + b*atanh(c*x))*log(2/(1 + c*x)))/(2*(c*d - e)^2*e) + (2*b*c^3*d*(a + b*atanh(c*x))*log(2/(1 + c*x)))/(c^2*d^2 - e^2)^2 - (b^2*c^2*log(1 + c*x))/(2*(c*d - e)^2*(c*d + e)) + (b^2*c^2*e*log(d + e*x))/(c^2*d^2 - e^2)^2 - (2*b*c^3*d*(a + b*atanh(c*x))*log((2*c*(d + e*x))/((c*d + e)*(1 + c*x))))/(c^2*d^2 - e^2)^2 + (b^2*c^2*PolyLog(2, 1 - 2/(1 - c*x)))/(4*e*(c*d + e)^2) + (b^2*c^2*PolyLog(2, 1 - 2/(1 + c*x)))/(4*(c*d - e)^2*e) - (b^2*c^3*d*PolyLog(2, 1 - 2/(1 + c*x)))/(c^2*d^2 - e^2)^2 + (b^2*c^3*d*PolyLog(2, 1 - (2*c*(d + e*x))/((c*d + e)*(1 + c*x))))/(c^2*d^2 - e^2)^2)]


    @test_int [(d + e*x)^3*(a + b*atanh(c*x))^3, x, 29, (3*a*b^2*d*e^2*x)/c^2 + (b^3*e^3*x)/(4*c^3) - (b^3*e^3*atanh(c*x))/(4*c^4) + (3*b^3*d*e^2*x*atanh(c*x))/c^2 + (b^2*e^3*x^2*(a + b*atanh(c*x)))/(4*c^2) - (3*b*d*e^2*(a + b*atanh(c*x))^2)/(2*c^3) + (b*e^3*(a + b*atanh(c*x))^2)/(4*c^4) + (3*b*e*(6*c^2*d^2 + e^2)*(a + b*atanh(c*x))^2)/(4*c^4) + (3*b*e*(6*c^2*d^2 + e^2)*x*(a + b*atanh(c*x))^2)/(4*c^3) + (3*b*d*e^2*x^2*(a + b*atanh(c*x))^2)/(2*c) + (b*e^3*x^3*(a + b*atanh(c*x))^2)/(4*c) + (d*(c^2*d^2 + e^2)*(a + b*atanh(c*x))^3)/c^3 - ((c^4*d^4 + 6*c^2*d^2*e^2 + e^4)*(a + b*atanh(c*x))^3)/(4*c^4*e) + ((d + e*x)^4*(a + b*atanh(c*x))^3)/(4*e) - (b^2*e^3*(a + b*atanh(c*x))*log(2/(1 - c*x)))/(2*c^4) - (3*b^2*e*(6*c^2*d^2 + e^2)*(a + b*atanh(c*x))*log(2/(1 - c*x)))/(2*c^4) - (3*b*d*(c^2*d^2 + e^2)*(a + b*atanh(c*x))^2*log(2/(1 - c*x)))/c^3 + (3*b^3*d*e^2*log(1 - c^2*x^2))/(2*c^3) - (b^3*e^3*PolyLog(2, 1 - 2/(1 - c*x)))/(4*c^4) - (3*b^3*e*(6*c^2*d^2 + e^2)*PolyLog(2, 1 - 2/(1 - c*x)))/(4*c^4) - (3*b^2*d*(c^2*d^2 + e^2)*(a + b*atanh(c*x))*PolyLog(2, 1 - 2/(1 - c*x)))/c^3 + (3*b^3*d*(c^2*d^2 + e^2)*PolyLog(3, 1 - 2/(1 - c*x)))/(2*c^3)]
    @test_int [(d + e*x)^2*(a + b*atanh(c*x))^3, x, 20, (a*b^2*e^2*x)/c^2 + (b^3*e^2*x*atanh(c*x))/c^2 + (3*b*d*e*(a + b*atanh(c*x))^2)/c^2 - (b*e^2*(a + b*atanh(c*x))^2)/(2*c^3) + (3*b*d*e*x*(a + b*atanh(c*x))^2)/c + (b*e^2*x^2*(a + b*atanh(c*x))^2)/(2*c) + ((3*c^2*d^2 + e^2)*(a + b*atanh(c*x))^3)/(3*c^3) - (d*(d^2 + (3*e^2)/c^2)*(a + b*atanh(c*x))^3)/(3*e) + ((d + e*x)^3*(a + b*atanh(c*x))^3)/(3*e) - (6*b^2*d*e*(a + b*atanh(c*x))*log(2/(1 - c*x)))/c^2 - (b*(3*c^2*d^2 + e^2)*(a + b*atanh(c*x))^2*log(2/(1 - c*x)))/c^3 + (b^3*e^2*log(1 - c^2*x^2))/(2*c^3) - (3*b^3*d*e*PolyLog(2, 1 - 2/(1 - c*x)))/c^2 - (b^2*(3*c^2*d^2 + e^2)*(a + b*atanh(c*x))*PolyLog(2, 1 - 2/(1 - c*x)))/c^3 + (b^3*(3*c^2*d^2 + e^2)*PolyLog(3, 1 - 2/(1 - c*x)))/(2*c^3)]
    @test_int [(d + e*x)^1*(a + b*atanh(c*x))^3, x, 14, (3*b*e*(a + b*atanh(c*x))^2)/(2*c^2) + (3*b*e*x*(a + b*atanh(c*x))^2)/(2*c) + (d*(a + b*atanh(c*x))^3)/c - ((d^2 + e^2/c^2)*(a + b*atanh(c*x))^3)/(2*e) + ((d + e*x)^2*(a + b*atanh(c*x))^3)/(2*e) - (3*b^2*e*(a + b*atanh(c*x))*log(2/(1 - c*x)))/c^2 - (3*b*d*(a + b*atanh(c*x))^2*log(2/(1 - c*x)))/c - (3*b^3*e*PolyLog(2, 1 - 2/(1 - c*x)))/(2*c^2) - (3*b^2*d*(a + b*atanh(c*x))*PolyLog(2, 1 - 2/(1 - c*x)))/c + (3*b^3*d*PolyLog(3, 1 - 2/(1 - c*x)))/(2*c)]
